import React from 'react';

interface Props {
    value?: string;
}

const sendEvent = (value: string) => {
    fetch(`https://eutils.ncbi.nlm.nih.gov/entrez/eutils/esearch.fcgi?db=pubmed&retmax=20&retmode=json&term=${value}`)
    .then(response => response.json())
    .then(data => console.log(data));
};

const SearchButton: React.FC<Props> = (props) => (
    <button className="input-search" onClick={() => console.log(props.value)}>
        Search now
    </button>
);

export default SearchButton;
